import React from 'react';

function ForgotPassword(props) {
  return (
    <div>
      <input
        name='email'
        placeholder='email'
        onChange={e => {e.persist();props.updateFormState(e)}}
      />
      <button onClick={props.forgotPassword}>Reset password</button>
    </div>
  )
}

export default ForgotPassword
